1. Die regte van mense soos die regte tot lewe, gesondheid en veiligheid; 
2. Die regte van mense soos die regte tot vrije bespreeking en meningsuiting; 
3. Die regte van mense soos die regte tot ongemengde toegang tot informatie; 
4. Die regte van mense soos die regte tot gebou en privaat lewe; 
